                "title": "The Verve Pipe - The Freshmen (Official Video)",
                "description": "The Verve Pipe's official music video for 'The Freshmen'. Click to listen to The Verve Pipe on Spotify: http://smarturl.it/TVPSpotify?IQid=TVPTF\n\nAs featured on Platinum & Gold Collection. Click to buy the track or album via iTunes: http://smarturl.it/TVPPGiTunes?IQid=TVPTF\nGoogle Play: http://smarturl.it/TVPTFPlay?IQid=TVPTF\nAmazon: http://smarturl.it/TVPPGAmazon?IQid=TVPTF\n\nMore from The Verve Pipe\nPhotograph: https://youtu.be/FTHVIwWFVK8\nVillains: https://youtu.be/H8RXMxioJQQ\nCup Of Tea: https://youtu.be/gsALY2fQX_Y\n\nMore great 90's Alternative videos here: http://smarturl.it/Alternative90?IQid=TVPTF\n\nFollow The Verve Pipe\nWebsite: http://www.thevervepipe.com\nFacebook: https://www.facebook.com/thevervepipe\nTwitter: https://twitter.com/thevervepipe\n\nSubscribe to The Verve Pipe on YouTube: http://smarturl.it/TVPSub?IQid=TVPTF\n\n---------\n\nLyrics:\n\nWhen I was young I knew everything\nAnd she, a punk who rarely ever took advice\nNow I'm guilt-stricken, sobbin' with my head on the floor\nStopped a baby's breath and a shoe full of rice, no\n\nCan't be held responsible\nShe was touchin' her face\nI won't be held responsible\nShe fell in love in the first place\n\nFor the life of me \nI can not remember \nWhat made us think that we were wise and we'd never compromise\nFor the life of me\nI can not believe we'd ever die \nFor these sins\nWe were merely freshmen\n\n#VervePipe #TheFreshmen #Vevo",
